function Home(props) {
  return (
    <div className="container">
      <div className="name-text">
        <p>Hi, I'm Michael Bubel.</p>
      </div>
      <div className="bio-text">
        <p>
          I'm currently enrolled in the UCSD Full Stack Development Program and
          projected to graduate in March of 2021.
        </p>
      </div>
    </div>
  );
}

export default Home;
